from Fantasy_Stats_Per_Game import player_averages

# Creates a list of players with their averages changed based on [Season, Arena, Last 10]
# listof(Skaters) -> listof(Skaters)
def grab_averages(los):

    complete_skaters_list = []

    for skater in los:

        arena = skater[4]
        avgs = player_averages(skater)
        print(avgs)
        if avgs[1] == 0 and avgs[2] == 0:
            print(avgs)

        # Average fantasy points in last 10 games
        last10_avg = avgs[1]
        # Average fantasy points at home or away
        if arena == "Home":
            arena_avg = avgs[2]
        else:
            arena_avg = avgs[3]

        skater[7] = round((skater[7] + last10_avg + arena_avg) / 3, 3)

        complete_skaters_list.append(skater)

    return complete_skaters_list


